//List Item for Paid Column In Order List

import React from 'react'
import RecieptMenuItem from '../../ClientUI/Menu/RecieptMenuItem';

class OrderListItem extends React.Component {
    constructor() {
      super();
    }

    render() {
      return (
  <div className="row OrderListRow">
  <div className="col receiptsCard">
      <div className="row">
          <div className="col-6 d-inline-flex">
              <p>User Name</p>
          </div>
          <div className="col-6 d-inline-flex">
              <p className="d-xl-flex ml-auto receiptTimestamp">Order No. {this.props.name}</p>
              <p className="d-xl-flex ml-auto FoodPriceLabelReceipt">112506</p>
          </div>
          <div className="col">
              <div className="cartItemDevider"></div>
          </div>
          {/* Order List Menu Item */}
          <RecieptMenuItem />
          {/* /Order List Menu Item */}
      </div>
  </div>
</div>

);
}
}

export default OrderListTab
